import React from "react";
import Fade from 'react-reveal/Fade';
import "./Contact.css";
const Contact = () => {
    return(
    <Fade top>
    <h1 id='contact' className="white tc" > Contact Me</h1>
    <div className="tc ">
    <form>
    <label for="fname" id='name' className="white tc" >First name:</label>
    <br />
    <input type="text" id="fname" name="fname" className="white tc" />
    <br />
    <label for="lname" className="white tc">Last name:</label>
    <br />
    <input type="text" id="lname" name="lname" className="white tc"/>
    </form>
    </div>
    </Fade>
    )
}

export default Contact;
